import { httpService } from './';
import { apiUrl } from '../config';

export const voucherService = {
    validateVoucherCode
};

const apiEndpoint = apiUrl + '/voucher';

function validateVoucherCode(code) {    
    return httpService.post(`${apiEndpoint}/validate`, { code });
}
